import * as React from "react"
import { Divider, Paper, TextField } from "@mui/material"
export default function HoursSelection() {
    const handleChange = (e) => {
        console.log(e)
    }

    return (<Paper elevation={12} sx={{padding: 1}}>
        <TextField 
            type="time"
            label="Heure du déjeuner"
            defaultValue="12:15"
            InputLabelProps={{
                shrink: true
            }}
            inputProps={{
                step: 300
            }}
            sx={{width: 150, display: "inline-block"}}
        />
        <Divider orientation="vertical" sx={{margin: 1, display: "inline-block"}} />
        <TextField 
            type="time"
            label="Heure du dîner"
            defaultValue="18:15"
            InputLabelProps={{
                shrink: true
            }}
            inputProps={{
                step: 300
            }}
            sx={{width: 150, display: "inline-block"}}
        />
    </Paper>)
}
